  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this study were to evaluate
  the effects of various grassland  management practices on refuge plant communities.
  Non-grazed (control), grazed and prescribed burned treatments were the three practices
  evaluated. Baseline data was collected during the spring of 1992 with the first
  prescribed bum (plot 1) conducted in October 1992. The study area (sections 15 and
  22) has a long history of grazing, dating back over 50 years. Due to the extended
  drought prior to 1992, grazing on section 15 was terminated after 1989. Field work
  was conducted from 1992 to 1994. However, due to a wildfire which burned 70% of
  the study area in June 1993, there were not enough unburned plots to do a statistical
  analysis for the 1994 data. The 1994 community parameters can be analyzed in the
  future to evaluate the results of the wildfire.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
